import React, { useState } from "react";
import Title from "./mypage/Title";
import UserInfo from "./mypage/UserInfo";
import BookmarkMenu from "./mypage/BookmarkMenu";
import BookmarkFolder from "./mypage/BookmarkFolder";
import BookmarkList from "./mypage/BookmarkList";
import FolderDropdown from "./mypage/FolderDropdown";

const Mypage = () => {
    const [isDropdownVisible, setIsDropdownVisible] = useState(false);

    return (
        <div>
            <Title />
            <UserInfo />
            <BookmarkMenu />
            <BookmarkFolder isDropdownVisible={isDropdownVisible} />
                {isDropdownVisible && <FolderDropdown />}
            <BookmarkList />
        </div>
    );
};

export default Mypage;
